import React from 'react';
import ReactPlayer from 'react-player'
// import video from './videos/18.mp4'
const Player = (props) => {
    // import video from './videos/18.mp4'
    const video = require('./' + props.path)
    return(
    <ReactPlayer 
    url={video}
    playing={true}
    controls={true} 
    width={"100%"}
    height={"65vh"}
    />
    )
}

export default Player;
